import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.itemsForMe[0].title}
        amount={props.itemsForMe[0].amount}
        date={props.itemsForMe[0].date}
      />
      <ExpenseItem
        title={props.itemsForMe[1].title}
        amount={props.itemsForMe[1].amount}
        date={props.itemsForMe[1].date}
      />
      <ExpenseItem
        title={props.itemsForMe[2].title}
        amount={props.itemsForMe[2].amount}
        date={props.itemsForMe[2].date}
      />
      <ExpenseItem
        title={props.itemsForMe[3].title}
        amount={props.itemsForMe[3].amount}
        date={props.itemsForMe[3].date}
      />
    </div>
  );
}

export default Expenses;
